import React from "react";
import styles from './styles.module.scss';

const ButtonComp = ({
    children = 'Button text',
    type = 'primary',
    size = 'medium',
    buttonClick,
}) => {
    return (
        <button className={`${styles.button} ${styles[type]} ${styles[size]}`} onClick={buttonClick}>
            {children}
        </button>
    )
}

export default ButtonComp
